          <h3>Smart people choose RetailClick</h3>
         

          <div>
            <footer className="footer">
              <h9 className="text-center">Copyright Â© 2010, Design By Deven</h9>
            </footer>
          </div>
        </div>
        <Features />
          <About />
          <WeOffer />
      </div>
    );
  }
}

export default homepage;
